import { Link } from 'react-router-dom';
const Navbar = () => {
    return ( 
        <nav className="navbar py-4 font-primary flex justify-between px-3">
            <div className="left-side-nav text-xs">
            <a>MENU</a>
            <a>SHOP</a>
            </div>

            <h1 className="text-xl justify-center">VALYOO</h1>
            <div className="links">
                <Link>Home</Link>
                <Link to="/create" style={{
                    color:"white",
                    backgroundColor:'#f1356d',
                    borderRadius: '8px'
                }}>New blog</Link>
            </div>

        </nav>
     );
}
 
export default Navbar;
